import React, { useState } from 'react';
import Timer from './Timer';
import BTSYoutube from './Youtube/BTSYoutube.js';
import KirbyYoutube from './Youtube/KirbyYoutube';
import './App.css';

function App() {

  const showBTS = () => {
    <BTSYoutube/>
  }
  return (
    <div className="App">
    <div className="Timer">
      <Timer/>
      </div>

      <div className="YoutubeButton">
        <button
        className="BTSBtn"
        onClick={<BTSYoutube/>}>
        BTS
        </button>

        <button
        className="KirbyBtn"
        onClick={<KirbyYoutube/>}>
        Kirby
        </button>
      </div>

      {/* <div className="Youtube">
      <BTSYoutube />
      </div> */}
    </div>
  )
}

export default App;
